const Container = styled.div`
    display: flex;
    width: 100%;
    height: 100vh;
`;

const Arrow = styled.div`
    
`;



function Slider() {
  return (
    <Container>
        <Arrow>
            <ArrowBackIosNewRoundedIcon />
            <ArrowForwardIosRoundedIcon />
        </Arrow>
    </Container>
  )
}

export default Slider
